import { useContext } from "react";
import Context from "./Context";
import CounterTimer from "./CounterTimer";

const App = () => {
  const timeContext = useContext(Context);

  return (
    <Context.Provider value={timeContext.time}>
      <CounterTimer />
    </Context.Provider>
  );
};

export default App;
